import React from "react";
import { Link } from "react-router-dom";
import { getAuth } from "firebase/auth";

const footer = (props) => {
  useEffect(() => {
    const auth = getAuth();
    const user = auth.currentUser;
    if (user !== null) {
      const uid = user.uid;
      const db = getDatabase();
      const usersRef = ref(db, "users/" + uid);
      onValue(usersRef, (snapshot) => {
        const data = snapshot.val();
        console.log("data", data);
        if (
          data &&
          data.type &&
          (data.type == "admin" || data.type == "commercial")
        ) {
          console.log("admin");
        } else {
          history.push("/");
        }
      });
    } else {
      history.push("/");
    }
  }, []);
  return (
    // Footer strat
    <footer className="footer">
      <div className="container">
        <div className="row">
          <div className="col-12 text-center">
            <Link to="index.html" className="logo foo-logo">
              <img src={require("../assets/images/logo.png")} alt="" />
            </Link>
            <nav className="foo-nav">
              <div>photo + email</div>
            </nav>
            {/*  <nav className="foo-nav">
              <ul>
                <li>
                  <Link to="#">ACCUEIL</Link>
                </li>
                <li><Link to="#">About</Link></li>
                                <li><Link to="#">feature</Link></li>
                                <li><Link to="#">service</Link></li>
    <li><Link to="#">Contact</Link></li>
              </ul>
            </nav>*/}
            <div className="foo-social">
              <Link to="#">
                <i className="ti-facebook"></i>
              </Link>
              <Link to="#">
                <i className="ti-twitter-alt"></i>
              </Link>
              <Link to="#">
                <i className="ti-instagram"></i>
              </Link>
            </div>
            <p className="copyright">
              &copy; COPYRIGHT 2022 <a href="#">unExtra</a> ALL RIGHTS RESERVED.
            </p>
          </div>
        </div>
      </div>
    </footer>
    // Footer end
  );
};

export default footer;
